import React from "react"
import Email from "./Email";
import Password from "./Password";
import { Form } from "react-router-dom";


function LoginPage(){
    return <div class="container">
    <Form action="">
      <div class="container">
        <h2>Login here</h2>
         <Email/>
         <Password/>
         <button type="submit">Login</button>
      </div>
    </Form>
  </div>
}

export default LoginPage;
